local directionKeys = {
[87] = 1, --forward
[32] = 2, --up
[340] = 3, --down
[83] = 4, --back
[65] = 5, --left
[68] = 6, --right
};

local actions = {
[0] = {"Move", turtle.forward, turtle.up, turtle.down, turtle.back, turtle.turnLeft, turtle.turnRight},
[85] = {"Dig (forward/up/down)", turtle.dig, turtle.digUp, turtle.digDown}, -- U
[73] = {"Place block (forward/up/down)", turtle.place, turtle.placeUp, turtle.placeDown}, -- I
[82] = {"Refuel (Non-directional)", turtle.refuel}, -- R
[57] = {"Change selected slot (forward/back)", selectAndSendSlot, deselectAndSendSlot}, -- 9
[80] = {"Get block details (forward/up/down)", observe, observeUp, observeDown}, -- P
[79] = {"Pick up item (forward/up/down)", turtle.suck, turtle.suckUp, turtle.suckDown}, -- O
[75] = {"Drop selected item (forward/up/down)", turtle.drop, turtle.dropUp, turtle.dropDown}, -- K
[56] = {"Equip selected item (left/right)",turtle.equipRight, turtle.equipLeft}, -- 8
[74] = {"Attack (forward/up/down)", turtle.attack, turtle.attackUp, turtle.attackDown}, -- J
}

function runAction(n, dir)
    if actions[n] then
        if #actions[n] == 2 then return actions[n][2](); end
        if #actions[n] == 3 then return actions[n][({2, 2, 3, 3, 3, 2})[dir]](); end
        if #actions[n] == 4 then return actions[n][({2, 3, 4, 4, 3, 2})[dir]](); end
        if #actions[n] == 7 then return actions[n][dir+1](); end
    else
        return "Key not mapped to an action (redundancy check)";
    end
end

peripheral.find("modem", rednet.open);
print("Reciever started - Connect to ID", os.computerID());
while true do
    id, message = rednet.receive();
    cmdKey = tonumber(message);
    if directionKeys[cmdKey] ~= nil then -- Do the current action
		local msg = tostring(runAction(currActKey, directionKeys[cmdKey]));
		actionUsed = true;
        if msg ~= "true" then
			rednet.send(id, msg);
		else
			rednet.send(id, "");
		end
    else
        if cmdKey == 0 then -- Reset the selected action
        	if not actionUsed and currActKey ~= 0 then
            	rednet.send(id, ("%s is mapped to %s"):format((keys.getName(currActKey)):upper(), actions[currActKey][1]));
        	else
            	rednet.send(id, "");
        	end
            currActKey = 0;
            actionUsed = false;
        else -- Select an action
			if actions[cmdKey] then
	            currActKey = cmdKey;
        		actionUsed = false;
				rednet.send(id, "");
			else
				currActKey = 0;
				rednet.send(id, "Key not mapped to an action");
			end
        end
    end
end

const canvas = document.getElementById("game")
const context = canvas.getContext('2d');

class Snake {
    constructor(x, y) {
        this.x = x
        this.y = y
    }
}
const tileCount = 20
const tileSize = canvas.clientWidth / tileCount - 2
let headX = 10
let headY = 10
let appleX = 3
let appleY = 3
let xVelocity = 0
let yVelocity = 0
let tailLength = 2
let score = 0
const snakeParts = []
function clearScreen() {
    context.fillStyle = "black"
    context.fillRect(0, 0, canvas.clientWidth, canvas.clientHeight)
}
function drawGame() {
    changeSnakePosition()

    if(isGameOver()) {
        return
    }
    clearScreen()
    drawSnake()
    drawApple()
    collisionDetection()
    drawScore()
    setTimeout(drawGame, 1000 / 7)
}
function drawSnake() {
    context.fillStyle = "green"
    for(let i = 0; i < snakeParts.length; i++) {
        let partOfSnake = snakeParts[i]
        context.fillRect(partOfSnake.x * tileCount, partOfSnake.y * tileCount, tileSize, tileSize)
    }
    snakeParts.push(new Snake(headX, headY))
    if(snakeParts.length > tailLength) {
        snakeParts.shift()
    }
    context.fillStyle = "orange"
    context.fillRect(headX * tileCount, headY * tileCount, tileSize, tileSize)
}
function drawScore() {
    context.fillStyle = "white"
    context.font = "16px arial"
    context.fillText("Score " + score, canvas.clientWidth - 60, 20)
}
// drawSnake()

function changeSnakePosition() {
    headX += xVelocity
    headY += yVelocity

    

}
function drawApple() {
    context.fillStyle = "red"
    context.fillRect(appleX * tileCount, appleY * tileCount, tileSize, tileSize)
}
function collisionDetection() {
    if(appleX === headX && appleY === headY) {
       appleX = Math.floor(Math.random() * tileCount)
       appleY = Math.floor(Math.random() * tileCount)
       tailLength++
       score++
    }
}
function isGameOver() {
    let over = false
    if(xVelocity === 0 && yVelocity === 0) {
        return false
    }
    if(headX < 0) {
        over = true
    }
    else if(headX === tileCount) {
        over = true
    }
    else if(headY < 0) {
        over = true
    }
    else if(headY === tileCount) {
        over = true
    }
    
    for(let i = 0; i < snakeParts.length; i++) {
        let partOfSnake = snakeParts[i]
        if(headX === partOfSnake.x && headY === partOfSnake.y) {
            over = true
            break
        }
    }
    if(over == true) {
        context.fillStyle = "white"
        context.font = "50px arial"
        context.fillText("GAME OVER!", canvas.clientWidth / 7, canvas.clientHeight / 2)
    }
    return over
}
document.addEventListener('keydown', keyPressed)

function keyPressed() {
    if(event.keyCode === 38) { // W
        if(yVelocity === 1) {
            return
        }

        xVelocity = 0
        yVelocity = -1
    }
    if(event.keyCode === 40) { // 

        if(yVelocity === -1) {
            return
        }

        xVelocity = 0
        yVelocity = 1
    }
    if(event.keyCode === 37) { // A
        if(xVelocity === 1) {
            return
        }

        xVelocity = -1
        yVelocity = 0
    }
    if(event.keyCode === 39) { // D
        if(xVelocity === -1) {
            return
        }

        xVelocity = 1
        yVelocity = 0
    }

}
