#define MAX_LENGTH 1024

int main() {

    SetConsoleCP(1251);
    SetConsoleOutputCP(1251);

    char secret_words[][MAX_LENGTH] = { "друг", "дом", "футбол", "музыка", "врач", "грач" };
    
    int cnt_words = 6;
  
    char guess[MAX_LENGTH];
    char word[MAX_LENGTH];
    char player1[MAX_LENGTH];
    char player2[MAX_LENGTH];
    char symb;
    int player = 1;
    int correctGuess = 0;

    
    printf("\nИгрок 1, введите свое имя: ");
    gets(player1);
    printf("\n");

    printf("Игрок 2, введите свое имя: ");
    gets(player2);
    printf("\n");

    char *secretWord = secret_words[rand() % cnt_words];
    printf("%s\n", secretWord);

    int attempts = (strlen(secretWord)) * 2;

    printf("Поехали!\n\n");

    printf("Внимание! Слово написано в маленьком регистре!\n");

    for (int i = 0; i < strlen(secretWord); i++) {
        guess[i] = '_';
    }
    guess[strlen(secretWord)] = '\0';

    while (attempts > 0) {
        int step = 0, correctGuess = 0;
        int wordComplete = 0;
        printf("Загаданное слово имеет %d букв! \n", strlen(secretWord));
        printf("%s\n", guess);
        printf("\nУ вас осталось %d попыток.\n", attempts);
        printf("Введите цифру 1, если хотите ввести букву.\n");
        printf("Введите цифру 2, если хотите ввести слово целиком.\n");
        scanf_s("%d", &step);
        printf("\n");
        if (step == 1) {
            printf("Игрок %d, введите букву: ", player);
            scanf_s(" %c", &symb);
            printf("\n");
            // Проверка угаданной буквы
            for (int i = 0; i < strlen(secretWord); i++) {
                if (secretWord[i] == symb) {
                    guess[i] = secretWord[i];
                    correctGuess += 1;
                }
            }
            // Проверка, есть ли еще незаполненные буквы
            if (strcmp(guess, secretWord) == 0)
                wordComplete = 1;
        }
        if (step == 2) {
            printf("Игрок %d, введите слово целиком:\n", player);
            getchar();
            gets(word);
            printf("\n");
            if (strcmp(word, secretWord) == 0)
                wordComplete = 1;
        }

        if (wordComplete) {
            printf("Поздравляю, игрок № %d (%s) выиграл!\n", player, (player == 1) ? player1 : player2);
            break;
        }

        attempts--;
       
        // Смена игрока
        player = (player == 1) ? 2 : 1;
    }

    if (attempts == 0) {
        printf("Игроки не угадали слово. Загаданное слово было: %s\n", secretWord);
    }

    return 0;
}

