using namespace std;

int main() {
    int N;
    int V;
    int **M, **M_copy, *D, *S, *L, **res;
    ifstream fin("fin.txt");
    ofstream fout("output.txt");
    fin >> N >> V;
    N = N + 1;
    M = new int *[N];
    M_copy = new int *[N];
    for (int i = 0; i < N; i++) {
        M_copy[i] = new int[N];
        for (int j = 0; j < N; j++) {
            M_copy[i][j] = 0;
        }
    }
    for (int i = 0; i < N; i++) {
        M[i] = new int[N];
        for (int j = 0; j < N; j++) {
            M[i][j] = 0;
        }
    }
    for (int i = 0; i < V; i++) {
        int a, b;
        fin >> a >> b;
        M[a][b] = 1;
        M[b][a] = 1;
    }
    for (int i = 0; i < N; i++) {
        for (int j = 0; j < N; j++) {
            fout << M[i][j] << ' ';
        }
        fout << endl;
    }
    fin.close();
    fout.close();
    fin.open("output.txt");
    fout.open("output2.txt");
    for (int i = 0; i < N; i++) {
        for (int j = 0; j < N; j++) {
            fin >> M_copy[i][j];
        }
    }
    S = new int[N];
    L = new int[N];
    D = new int[N*N];
    S[1] = 1;
    int ind = 1;
    for (int i = 1; i < N; i++) {
        for (int j = 1; j < N; j++) {
            if(M[i][j] == 1){
                D[ind] = j;
                L[i]++;
                ind++;
            }
        }
        if(i >= 2){
            S[i] = S[i-1] + L[i-1];
        }
    }
    fout << N*N << endl;
    for(int i=1; i < N*N; i++){
        fout << D[i] << ' ';
    }
    fout << endl;
    fout << N << endl;
    for(int i=1; i < N; i++){
        fout << L[i] << ' ';
    }
    fin.close();
    fout.close();
    fout.open("output3.txt");
    ind = 1;
    res = new int *[N];
    int l = 1;
    for(int i = 1; i < N; i++){
        for(int j = 0; j < L[i]; ++j){
            if(i < D[ind]){
                res[l] = new int[2];
                res[l][0] = i;
                res[l][1] = D[ind];
                l++;
            }
            ind++;
        }
    }
    for(int i = 1; i < N; i++){
        cout << res[i][0] << " " << res[i][1] << endl;
    }
    return 0;
}

#include <Adafruit_ILI9341.h>      // Include the ILI9341 library
#include <Adafruit_GFX.h>          // Include the Adafruit graphics library
#include <SD.h>                    // Include the SD library

// Pins for relays
const int relay1Pin = 2;
const int relay2Pin = 3;
const int relay3Pin = 4;
const int relay4Pin = 5;
const int relay5Pin = 6;

// Analog input pin for 4-20mA input
const int analogInputPin = A0;

// Pins for LCD screen
const int TFT_CLK = 13;
const int TFT_MISO = 12;
const int TFT_MOSI = 11;
const int TFT_CS = 10;
const int TFT_DC = 9;
const int TFT_RST = 8;

// Initialize the LCD screen
Adafruit_ILI9341 tft = Adafruit_ILI9341(TFT_CS, TFT_DC, TFT_RST, TFT_CLK, TFT_RST, TFT_MISO);

// Variables to store relay states
bool relay1State = false;
bool relay2State = false;
bool relay3State = false;
bool relay4State = false;
bool relay5State = false;

// Timers for controlling the relays
unsigned long relay1Interval = 1000;   // Relay 1 interval in milliseconds
unsigned long relay2Interval = 2000;   // Relay 2 interval in milliseconds
unsigned long relay3Interval = 3000;   // Relay 3 interval in milliseconds
unsigned long relay4Interval = 4000;   // Relay 4 interval in milliseconds
unsigned long relay5Interval = 5000;   // Relay 5 interval in milliseconds

unsigned long relay1PreviousMillis = 0;
unsigned long relay2PreviousMillis = 0;
unsigned long relay3PreviousMillis = 0;
unsigned long relay4PreviousMillis = 0;
unsigned long relay5PreviousMillis = 0;

// Variables for analog input
float analogValue = 0.0;
unsigned long analogPreviousMillis = 0;
unsigned long analogInterval = 1000;

// SD card chip select pin
const int SD_CS = 4;

// Serial output interval for analog input
unsigned long serialPreviousMillis = 0;
unsigned long serialInterval = 15000;

// Serial output interval for date
unsigned long dateSerialPreviousMillis = 0;
unsigned long dateSerialInterval = 15000;

void setup() {
  // Initialize the relays as output pins
  pinMode(relay1Pin, OUTPUT);
  pinMode(relay2Pin, OUTPUT);
  pinMode(relay3Pin, OUTPUT);
  pinMode(relay4Pin, OUTPUT);
  pinMode(relay5Pin, OUTPUT);

  // Initialize the LCD screen
  tft.begin();
  tft.setRotation(3);   // Set the screen rotation if needed
  tft.fillScreen(ILI9341_BLACK);   // Clear the screen

  // Initialize the SD card
  if (!SD.begin(SD_CS)) {
    tft.println("SD card initialization failed!");
    while (1);
  }

  // Draw initial circles to represent relay states
  drawCircles();

  // Initialize Serial communication for analog input
  Serial.begin(9600);

  // Initialize Serial communication for date output
  Serial1.begin(9600);
}

void loop() {
  // Get the current time
  unsigned long currentMillis = millis();

  // Relay control
  if (currentMillis - relay1PreviousMillis >= relay1Interval) {
    relay1PreviousMillis = currentMillis;
    relay1State = !relay1State;  // Toggle relay state
    digitalWrite(relay1Pin, relay1State);
    updateCircles();  // Update the circles to reflect the relay state
  }

  if (currentMillis - relay2PreviousMillis >= relay2Interval) {
    relay2PreviousMillis = currentMillis;
    relay2State = !relay2State;  // Toggle relay state
    digitalWrite(relay2Pin, relay2State);
    updateCircles();  // Update the circles to reflect the relay state
  }

  if (currentMillis - relay3PreviousMillis >= relay3Interval) {
    relay3PreviousMillis = currentMillis;
    relay3State = !relay3State;  // Toggle relay state
    digitalWrite(relay3Pin, relay3State);
    updateCircles();  // Update the circles to reflect the relay state
  }

  if (currentMillis - relay4PreviousMillis >= relay4Interval) {
    relay4PreviousMillis = currentMillis;
    relay4State = !relay4State;  // Toggle relay state
    digitalWrite(relay4Pin, relay4State);
    updateCircles();  // Update the circles to reflect the relay state
  }

  if (currentMillis - relay5PreviousMillis >= relay5Interval) {
    relay5PreviousMillis = currentMillis;
    relay5State = !relay5State;  // Toggle relay state
    digitalWrite(relay5Pin, relay5State);
    updateCircles();  // Update the circles to reflect the relay state
  }

  // Analog input read
  if (currentMillis - analogPreviousMillis >= analogInterval) {
    analogPreviousMillis = currentMillis;
    analogValue = readAnalogInput();
  }

  // Serial output for analog input
  if (currentMillis - serialPreviousMillis >= serialInterval) {
    serialPreviousMillis = currentMillis;
    outputSerial(analogValue);
  }

  // Serial output for date
  if (currentMillis - dateSerialPreviousMillis >= dateSerialInterval) {
    dateSerialPreviousMillis = currentMillis;
    outputDate();
  }

  delay(100);
}

// Function to read the analog input
float readAnalogInput() {
  int rawValue = analogRead(analogInputPin);
  float voltage = rawValue * (5.0 / 1023.0);
  float current = (voltage - 0.5) * (16.0 / 4.5);
  return current;
}

// Function to output the value to Serial and SD card
void outputSerial(float value) {
  Serial.print("Analog Input: ");
  Serial.print(value);
  Serial.println(" mA");

  // Open the CSV file in append mode
  File dataFile = SD.open("data.csv", FILE_WRITE);

  if (dataFile) {
    // Append the value to the file
    dataFile.print(value);
    dataFile.println(" mA");

    // Close the file
    dataFile.close();
  } else {
    Serial.println("Error opening data.csv");
  }
}

// Function to output the current date to Serial
void outputDate() {
  // Get the current date and time
  String date = getDate();

  // Send the date to the modem on Serial1
  Serial1.println(date);
}

// Function to get the current date
String getDate() {
  String date = "";

  // Get the current date and time
  int year = year();
  int month = month();
  int day = day();
  int hour = hour();
  int minute = minute();
  int second = second();

  // Format the date string
  date += String(year) + "-";
  if (month < 10) {
    date += "0";
  }
  date += String(month) + "-";
  if (day < 10) {
    date += "0";
  }
  date += String(day) + " ";
  if (hour < 10) {
    date += "0";
  }
  date += String(hour) + ":";
  if (minute < 10) {
    date += "0";
  }
  date += String(minute) + ":";
  if (second < 10) {
    date += "0";
  }
  date += String(second);

  return date;
}

// Function to draw the initial circles
void drawCircles() {
  // Relay 1 circle
  tft.fillCircle(50, 50, 30, ILI9341_BLUE);

  // Relay 2 circle
  tft.fillCircle(100, 50, 30, ILI9341_BLUE);

  // Relay 3 circle
  tft.fillCircle(150, 50, 30, ILI9341_BLUE);

  // Relay 4 circle
  tft.fillCircle(200, 50, 30, ILI9341_BLUE);

  // Relay 5 circle
  tft.fillCircle(250, 50, 30, ILI9341_BLUE);
}

// Function to update the circles with relay states
void updateCircles() {
  // Relay 1 circle
  if (relay1State)
    tft.fillCircle(50, 50, 30, ILI9341_GREEN);
  else
    tft.fillCircle(50, 50, 30, ILI9341_RED);

  // Relay 2 circle
  if (relay2State)
    tft.fillCircle(100, 50, 30, ILI9341_GREEN);
  else
    tft.fillCircle(100, 50, 30, ILI9341_RED);

  // Relay 3 circle
  if (relay3State)
    tft.fillCircle(150, 50, 30, ILI9341_GREEN);
  else
    tft.fillCircle(150, 50, 30, ILI9341_RED);

  // Relay 4 circle
  if (relay4State)
    tft.fillCircle(200, 50, 30, ILI9341_GREEN);
  else
    tft.fillCircle(200, 50, 30, ILI9341_RED);

  // Relay 5 circle
  if (relay5State)
    tft.fillCircle(250, 50, 30, ILI9341_GREEN);
  else
    tft.fillCircle(250, 50, 30, ILI9341_RED);
}

